        [color=#B5051d] [/color]         [head=1]Greetings![/head]

        ====================================================

        [head=3]We expect great things from you as one of our representitive as an arms dealer. However, we do not expect it will be easy to sell our goods, so we have seen fit to give you some tools to better your chances of success.


        On your shuttle you will find a large batch of product entrusted to you to trade. At the back of your ship there is a hidden compartment with "Legally" acquired NT branded merchandise and our most exotic weapons commodity. Strive and bring home at least [color=#B5051d]50k spesos[/color] in profit each.


        It's important you don't leave the shuttle and guard it with your life. It's your home and livelyhood as far as you are concerned.


        The current stock is not to be toyed with, anything that does not sell is a large loss of profit, and if the list comes up short, it will be paid back twofold for your incompetence with life or limb. Keep that in mind when you decide to use stock to protect yourself or your mission.


        That being said, NT will likely not take kindly to your presense and less so to the goods you hold, avoid detection. It goes without saying that includes docking to the station itself. Do not under any circumstances let local authorities inspect your shuttle. If you are at any point discovered or captured, your contract will become void, and any and all benifits or protection of life and kin are now forfeited. Do not expect us to interfere or do you any favors beyond what we already entrusted you with.


        Lastly, should you encounter any of our agents or operatives out and about, do help them if you can at a cost. We aren't a charity and anything you make doing so will be considered your bonus.[/head]

        ====================================================

        [italic]Destroy this message after you have read it.[/italic]
